import{_ as e,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"RELEASE SAVEPOINT","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/RELEASE_SAVEPOINT.md","filePath":"docs/7x/ref_guide/sql_commands/RELEASE_SAVEPOINT.md"}'),n={name:"docs/7x/ref_guide/sql_commands/RELEASE_SAVEPOINT.md"};function i(l,a,r,p,d,h){return s(),t("div",null,a[0]||(a[0]=[o(`<h1 id="release-savepoint" tabindex="-1">RELEASE SAVEPOINT <a class="header-anchor" href="#release-savepoint" aria-label="Permalink to &quot;RELEASE SAVEPOINT&quot;">​</a></h1><p>Destroys a previously defined savepoint.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>RELEASE [SAVEPOINT] &lt;savepoint_name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>RELEASE SAVEPOINT</code> destroys a savepoint previously defined in the current transaction.</p><p>Destroying a savepoint makes it unavailable as a rollback point, but it has no other user visible behavior. It does not undo the effects of commands run after the savepoint was established. (To do that, see <a href="./ROLLBACK_TO_SAVEPOINT.html">ROLLBACK TO SAVEPOINT</a>.) Destroying a savepoint when it is no longer needed may allow the system to reclaim some resources earlier than transaction end.</p><p><code>RELEASE SAVEPOINT</code> also destroys all savepoints that were established <em>after</em> the named savepoint was established.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>savepoint_name : The name of the savepoint to destroy.</p><h2 id="notes" tabindex="-1"><a id="section_notes"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section_notes&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>Specifying a savepoint name that was not previously defined is an error.</p><p>It is not possible to release a savepoint when the transaction is in an aborted state.</p><p>If multiple savepoints have the same name, WarehousePG releases only the most recently defined unreleased savepoint. Repeated commands release progressively older savepoints.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To establish and later destroy a savepoint:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>BEGIN;</span></span>
<span class="line"><span>    INSERT INTO table1 VALUES (3);</span></span>
<span class="line"><span>    SAVEPOINT my_savepoint;</span></span>
<span class="line"><span>    INSERT INTO table1 VALUES (4);</span></span>
<span class="line"><span>    RELEASE SAVEPOINT my_savepoint;</span></span>
<span class="line"><span>COMMIT;</span></span></code></pre></div><p>The above transaction inserts both 3 and 4.</p><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>This command conforms to the SQL standard. The standard specifies that the key word <code>SAVEPOINT</code> is mandatory, but WarehousePG allows it to be omitted.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./BEGIN.html">BEGIN</a>, <a href="./COMMIT.html">COMMIT</a>, <a href="./ROLLBACK.html">ROLLBACK</a>, <a href="./ROLLBACK_TO_SAVEPOINT.html">ROLLBACK TO SAVEPOINT</a>, <a href="./SAVEPOINT.html">SAVEPOINT</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,23)]))}const u=e(n,[["render",i]]);export{m as __pageData,u as default};
